import './Content.css';
import { Route, Routes } from 'react-router-dom';


export default function Content(props) {
  return (
    <main className={ 'Content' }>
      <Routes>
        <Route path="/" element={ <App /> }>
        </Route>
      </Routes>
    </main>
  );
}
